import Header from "../components/Header";
import Head from "next/head";

export default  class extends React.Component {



    render(){
        return(
            <div>
                <Head>
                    <Header/>
                </Head>
                <h3>{this.props.url.query.title}</h3>

            </div>
            );
    }
}
